Mongoose: Deleting deeply nested array subdocuments<p>I'm starting my first real project and have been running into frustrations regarding how to deal with nested subdocuments in Mongoose.</p>

<p>What's the best approach for deleting subdocuments that are nested 2 or 3 times, and we don't know the exact index of the array?</p>

<p>e.g. for a schema that looks like:</p>

<pre><code>var showSchema = new mongoose.Schema({
    title: String,
    description: String,
    seasons: [{
        name: String,
        videos: [{
            description: String,
            url: String,
            comments: [{
                content: String,
                authorName: String,
            }]
        }]
    }]
});
</code></pre>

<p>I've seen mention of using something like:</p>

<pre><code>Show.findByIdAndUpdate({'_id': showId, 'seasons._id': seasonId}, {'$pull': {'seasons.$.videos': {'videos._id': videoId}}}, function(err)...
</code></pre>

<p>Or something of the like.</p>

<p>What about if we wanted to delete a comment?  A comment is nested further down and AFAIK MongoDB only allows one $.  In my case, I don't know the index of any of these arrays.  </p>

<p>Does Mongoose have a method we can use?  I haven't had much look figuring out the Mongoose documentation.</p>

<p>I appreciate any help!</p>

<hr>

<p><strong>EDIT:</strong><br>
I have been told by someone more knowledgeable than I that deep nesting like this is not recommended.  Would it be better for me to limit nesting to one level deep and split things off into their own documents that connect with references?</p>

